const std::string DATAFOLDER = "demoData";
std::string ccLocation = "/cryptocontext";
std::string pubKeyLocation = "/key_pub";    // Pub key
std::string multKeyLocation = "/key_mult";  // relinearization key
std::string rotKeyLocation = "/key_rot";    // automorphism / rotation key
std::string sumKeyLocation = "/key_sum";
std::string cipherLocation = "/ciphertext";

std::string ccFinalLocation = "/cryptocontextFinal";
std::string cipherFinalLocation = "/ciphertextFinal";

uint sendFile(int conn, std::string file);

uint receiveFile(int connection, std::string &fileName_,  long &fileSize_){
  // read file info -> size|name
  std::string data;
  while(1){
    char buffer[1024];
    long bytesRead = read(connection, buffer, 1);
    for (int i=0;i<bytesRead;i++){
      if ('\n' == buffer[i]) break;
      data += buffer[i];
    }
    if ((0 == bytesRead) || ('\n' == buffer[0])){
      break;
    }
    // if "@" or "#" is the first character that means that 
    //  client wants to receive the computation results
    if ('@' == buffer[0]){
      sendFile(connection, DATAFOLDER+ccFinalLocation);
      return 0;
    }
    else if ('#' == buffer[0]){
      sendFile(connection, DATAFOLDER+cipherFinalLocation);
      return 0;
    }
  }

  long n = data.find("|");
  long fileSize = stoi(data.substr(0, n));
  std::string fileName = data.substr(n+1);
  fileSize_ = fileSize;
  fileName_ = fileName;

  // read file
  char* file;
  file = (char *)calloc(1, fileSize+1);
  long fileSizeRead = 0;
  while(1){
    char* buffer = (char *)calloc(1, fileSize+1);
    long bytesRead = read(connection, buffer, fileSize);
    for (int i=0;i<bytesRead;i++){
      file[i+fileSizeRead] = buffer[i];
    }
    fileSizeRead += bytesRead;
    free(buffer);
    if (0 == bytesRead){
      break;
    }
  }
  if (fileSizeRead == fileSize){
    std::cout << "file received: " << fileName << " (size:" << fileSize << ")" << std::endl;
    auto fp = fopen((DATAFOLDER+"/"+fileName).c_str(), "wb");
    fwrite(file, sizeof(char), fileSize, fp);
    fclose(fp);
    free(file);
    return 0;
  }

  return -1;
}

int exist(const char *name)
{
  struct stat   buffer;
  return (stat (name, &buffer) == 0);
}

void cleanFiles(){
  std::remove((DATAFOLDER+rotKeyLocation).c_str());
  std::remove((DATAFOLDER+multKeyLocation).c_str());
  std::remove((DATAFOLDER+pubKeyLocation).c_str());
  std::remove((DATAFOLDER+ccLocation).c_str());
  std::remove((DATAFOLDER+cipherLocation).c_str());
}

std::tuple<CryptoContext<DCRTPoly>, LPPublicKey<DCRTPoly>, Ciphertext<DCRTPoly>, uint>
deserialize(){
    CryptoContext<DCRTPoly> cc;
    Ciphertext<DCRTPoly> c1;
    LPPublicKey<DCRTPoly> pub_key;

    cc->ClearEvalMultKeys();
    cc->ClearEvalAutomorphismKeys();
    lbcrypto::CryptoContextFactory<lbcrypto::DCRTPoly>::ReleaseAllContexts();
    if (!Serial::DeserializeFromFile(DATAFOLDER + ccLocation, cc, SerType::BINARY)) {
      std::cerr << "I cannot read serialized data from: " << DATAFOLDER << ccLocation << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }
    std::cout << "\tCrypto context deserialized" << std::endl;

    if (!Serial::DeserializeFromFile(DATAFOLDER + pubKeyLocation, pub_key, SerType::BINARY)) {
      std::cerr << "I cannot read serialized data from: " << DATAFOLDER << pubKeyLocation << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }
    std::cout << "\tPub Key deserialized" << std::endl;

    std::ifstream multKeyIStream(DATAFOLDER + multKeyLocation, std::ios::in | std::ios::binary);
    if (!multKeyIStream.is_open()) {
      std::cerr << "Cannot read serialization from " << DATAFOLDER + multKeyLocation << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }
    if (!cc->DeserializeEvalMultKey(multKeyIStream, SerType::BINARY)) {
      std::cerr << "Could not deserialize eval mult key file" << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }

    std::cout << "\tDeserialized eval mult keys" << std::endl;
    std::ifstream rotKeyIStream(DATAFOLDER + rotKeyLocation, std::ios::in | std::ios::binary);
    if (!rotKeyIStream.is_open()) {
      std::cerr << "Cannot read serialization from " << DATAFOLDER + multKeyLocation << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }
    if (!cc->DeserializeEvalAutomorphismKey(rotKeyIStream, SerType::BINARY)) {
      std::cerr << "Could not deserialize eval rot key file" << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }

    std::cout << "\tDeserialized eval sum keys" << std::endl;
    std::ifstream sumKeyIStream(DATAFOLDER + sumKeyLocation, std::ios::in | std::ios::binary);
    if (!sumKeyIStream.is_open()) {
      std::cerr << "Cannot read serialization from " << DATAFOLDER + sumKeyLocation << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }
    if (!cc->DeserializeEvalSumKey(sumKeyIStream, SerType::BINARY)) {
      std::cerr << "Could not deserialize eval sum key file" << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }

    if (!Serial::DeserializeFromFile(DATAFOLDER + cipherLocation, c1, SerType::BINARY)) {
      std::cerr << "Cannot read serialization from " << DATAFOLDER + cipherLocation << std::endl;
      return std::make_tuple(cc, pub_key, c1, -1);
    }
    std::cout << "\tDeserialized ciphertext1" << std::endl;

    return std::make_tuple(cc, pub_key, c1, 0);
}

Ciphertext<DCRTPoly> linear(CryptoContext<DCRTPoly> cc, Ciphertext<DCRTPoly> cInput, vector<vector<double>> w, vector<double> b){
  Plaintext w_ptxt;
  Plaintext b_ptxt;

  // y1 = input*W
  vector<Ciphertext<DCRTPoly>> wRows;
  for (auto i=0; i<w.size(); i++){
    w_ptxt = cc->MakeCKKSPackedPlaintext(w[i]);
    auto cTemp = cc->EvalMult(cInput, w_ptxt);
    auto cRowSum = cc->EvalSum(cTemp, 1024);
    wRows.push_back(cRowSum);
  }
  Ciphertext<DCRTPoly> cY1 = cc->EvalMerge(wRows);

  // y2 = y1+b
  b_ptxt = cc->MakeCKKSPackedPlaintext(b);
  Ciphertext<DCRTPoly> cY2 = cc->EvalAdd(cY1, b_ptxt);

  return cY2;
}


