uint processFiles(){
  if (exist((DATAFOLDER+rotKeyLocation).c_str()) && 
      exist((DATAFOLDER+multKeyLocation).c_str()) && 
      exist((DATAFOLDER+pubKeyLocation).c_str()) && 
      exist((DATAFOLDER+ccLocation).c_str()) && 
      exist((DATAFOLDER+cipherLocation).c_str())){
    std::cout << "Processing files" << std::endl;

    auto tupleRes = deserialize();
    auto retCode = std::get<3>(tupleRes);
    if (retCode != -1){
      auto cc = std::get<0>(tupleRes);
      auto pub_key = std::get<1>(tupleRes);
      auto cInput = std::get<2>(tupleRes);

      auto cFinal = compute(cc, pub_key, cInput);

      serialize(cc, cFinal);

      cleanFiles();
      return 1;
    }
    else {
      cleanFiles();
      return -1;
    }

  }
  return 0;
}

unsigned int sendFile(int conn, std::string file){
  // based on https://stackoverflow.com/questions/3747086/reading-the-whole-text-file-into-a-char-array-in-c
  std::cout << "Sending file " << file << std::endl;

  long lSize;
  char *buffer;

  auto fp = fopen (file.c_str(), "rb");
  if( !fp ) {
    std::cout << "file open failed" << std::endl;
    return -1;
  }

  fseek( fp , 0L , SEEK_END);
  lSize = ftell( fp );
  rewind( fp );

  /* allocate memory for entire content */
  buffer = (char *)calloc( 1, lSize+1 );
  if( !buffer ) {
    fclose(fp);
    close(conn);
    std::cout << "memory alloc fails" << std::endl;
    return -1;
  }

  /* copy the file into the buffer */
  if( 1!=fread( buffer , lSize, 1 , fp) ){
    fclose(fp);
    free(buffer);
    close(conn);
    std::cout << "entire read fails" << std::endl;
    return -1;
  }

  std::string fileName = "";
  if (file.find("cryptocontext") != string::npos){
    fileName = "cryptocontext";
  }
  else if (file.find("key_pub") != string::npos){
    fileName = "key_pub";
  }
  else if (file.find("key_mult") != string::npos){
    fileName = "key_mult";
  }
  else if (file.find("key_rot") != string::npos){
    fileName = "key_rot";
  }
  else if (file.find("ciphertext") != string::npos){
    fileName = "ciphertext";
  }

  std::string lSizeStr = std::to_string(lSize);
  std::string fileInfo = lSizeStr+"|"+fileName+"\n";

  send(conn, fileInfo.c_str(), strlen(fileInfo.c_str()), 0);
  send(conn, buffer, lSize, 0);

  /* cleanup */
  fclose(fp);
  free(buffer);
  close(conn);
  return 0;
}

int main() {
  std::cout << "STARTUP" << std::endl;
  cleanFiles();

  // Create a socket (IPv4, TCP)
  int sockfd = socket(AF_INET, SOCK_STREAM, 0);
  if (sockfd == -1) {
    std::cout << "Failed to create socket. errno: " << errno << std::endl;
    exit(EXIT_FAILURE);
  }

  // Listen to port 9999 on any address
  sockaddr_in sockaddr;
  sockaddr.sin_family = AF_INET;
  sockaddr.sin_addr.s_addr = INADDR_ANY;
  sockaddr.sin_port = htons(9998); // htons is necessary to convert a number to
                                   // network byte order
  if (bind(sockfd, (struct sockaddr*)&sockaddr, sizeof(sockaddr)) < 0) {
    std::cout << "Failed to bind to port 9998. errno: " << errno << std::endl;
    exit(EXIT_FAILURE);
  }

  while(1){
    // Start listening. Hold at most 10 connections in the queue
    if (listen(sockfd, 10) < 0) {
        std::cout << "Failed to listen on socket. errno: " << errno << std::endl;
        exit(EXIT_FAILURE);
    }
    // Read from the connection
    // Grab a connection from the queue
    auto addrlen = sizeof(sockaddr);
    int connection = accept(sockfd, (struct sockaddr*)&sockaddr, (socklen_t*)&addrlen);
    if (connection < 0) {
        std::cout << "Failed to grab connection. errno: " << errno << std::endl;
        exit(EXIT_FAILURE);
    }

    std::string fileName;
    long fileSize;
    receiveFile(connection, fileName, fileSize);

    processFiles();

    std::string response = "-";
    send(connection, response.c_str(), response.size(), 0);
    close(connection);
  }

  // Close the connections
  close(sockfd);
}
